import React, { Component } from "react";
import "./Home.css";

export default class Home extends Component {
    render() {
        return (
            <div className="Home">
                <div className="lander">
                    <h1>Mcgugin Dining Center Menu</h1>
                    <p>Sign in to see the daily menu</p>
                </div>
            </div>
        );
    }
}
